  \"2015-02-04T19:08:13.495596\",\n\t\"name\": \"group-ride-vehicle-pilot-program-drivers-4217c\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The New York City Taxi and Limousine Commission
  (TLC) has approved a new Group Ride Vehicle pilot program to provide an alternative
  transportation option for New Yorkers in neighborhoods with reduced or eliminated
  bus service. This new service will allow point to point, shared-rides among specified
  pick-up and drop-off locations. This pilot program will run for one year.  All licenses
  issued under this pilot will expire one-year from date of issuance.  This lists
  the license number, name, and license expiration date of approved drivers.\",\n\t\"license_title\":
